def binary_search(arr, target):
    (left, right) = (0, len(arr) - 1)
    while left < right:
        mid = left + (right - left) // 2
        vals = [int(val) for sublist in [x.split('*') for x in arr[mid].split()] for val in sublist]
        for val in vals:
            if val == target:
                return True
            elif val < target:
                left = mid + 1
            else:
                right = mid - 1
    return False

